def blocker_forward(x):
    x1 = blocker_encoder_0(x)
    x1 = relu(x1)
    x2 = blocker_encoder_2(x1)
    x2 = relu(x2)
    # Action head (new structure)
    action = blocker_action_head_0(x2)
    action = relu(action)
    action = blocker_action_head_2(action)
    # Extract action components
    angle = math.tanh(action[0])
    thrust = sigmoid([action[1]])[0]
    boost_prob = sigmoid([action[2]])[0]
    shield_prob = sigmoid([action[3]])[0]
    return angle, thrust, shield_prob, boost_prob

import sys
import math

# Read game input
laps = int(input())
checkpoint_count = int(input())
checkpoints = []
for i in range(checkpoint_count):
    checkpoint_x, checkpoint_y = [int(j) for j in input().split()]
    checkpoints.append((checkpoint_x, checkpoint_y))

# Game state
boost_used = [False, False]  # Track boost usage for each pod
turn_count = 0

# Game loop
while True:
    turn_count += 1
    
    # Read all pod data
    pod_data_all = []
    for i in range(2):
        x, y, vx, vy, angle, next_checkpoint_id = [int(j) for j in input().split()]
        pod_data_all.append((x, y, vx, vy, angle, next_checkpoint_id))
    
    # Read opponent data
    opponent_data = []
    for i in range(2):
        x, y, vx, vy, angle, next_checkpoint_id = [int(j) for j in input().split()]
        opponent_data.append((x, y, vx, vy, angle, next_checkpoint_id))

    # Process each pod and store commands
    commands = []
    for pod_id in range(2):
        # Get observations (56 dimensions matching training)
        obs = get_observations(
            pod_data_all[pod_id], 
            opponent_data, 
            checkpoints, 
            boost_used, 
            pod_id
        )

        # Get model predictions based on role
        if pod_id == 0:  # Runner
            angle_output, thrust, shield_prob, boost_prob = runner_forward(obs)
        else:  # Blocker
            angle_output, thrust, shield_prob, boost_prob = blocker_forward(obs)

        # Convert model outputs to action format
        x, y, vx, vy, angle, next_checkpoint_id = pod_data_all[pod_id]
        next_checkpoint_x, next_checkpoint_y = checkpoints[next_checkpoint_id]
        
        # The model outputs an angle adjustment in range [-1, 1]
        # Convert to degree adjustment [-18, 18] as in training
        angle_adjustment = angle_output * 18.0
        
        # Calculate target angle
        base_angle_to_checkpoint = math.degrees(math.atan2(next_checkpoint_y - y, next_checkpoint_x - x))
        target_angle = base_angle_to_checkpoint + angle_adjustment
        
        # Convert to target coordinates
        target_angle_rad = math.radians(target_angle)
        target_distance = 10000  # Fixed distance for target point
        target_x = x + math.cos(target_angle_rad) * target_distance
        target_y = y + math.sin(target_angle_rad) * target_distance

        # Determine action based on model outputs
        # Priority: Shield > Boost > Normal Thrust
        if shield_prob > 0.5:
            thrust_command = 'SHIELD'
        elif boost_prob > 0.5 and not boost_used[pod_id]:
            thrust_command = 'BOOST'
            boost_used[pod_id] = True
        else:
            # Convert normalized thrust [0, 1] to game thrust [0, 100]
            thrust_value = max(0, min(100, int(thrust * 100)))
            thrust_command = str(thrust_value)

        # Store command for this pod
        commands.append(f"{int(target_x)} {int(target_y)} {thrust_command} {pod_id} {angle_output:.3f} {thrust:.3f} {shield_prob:.3f} {boost_prob:.3f}")

    # Output commands for both pods
    for command in commands:
        print(command)
